import React from 'react';
import { useEffect, useState } from "react";
import axios from 'axios';
import { useParams } from 'react-router-dom';

function AdminLoanCard(){
    const [employees, setEmployees] = useState([]);
    const params=useParams();
    const getAll = async () => {
        const response = await axios.get(`http://localhost:8080/api/v2/loan`);
        console.log("This is from get All", response.data);
        return response.data;
      };

    useEffect(() => {
        return async () => {
        const response = await getAll();
        setEmployees(response);
        console.log("This is from useEffect", response);
        };
    }, []);
    return(
        <div>
            <center>
                <div className='container' style={{"padding-top":"7%"}}>
                    <div><h1>Issued Item Details</h1></div><br/>
                    <table className="table table-striped table-bordered">
        <thead>
          <tr>
            <th>Item-Id</th>
            <th>Loan Type</th>
            <th>Duration in Years</th>
            <center><th>Status</th></center>
          </tr>
        </thead>
        <tbody>
          {employees.map((employee) => (
            <tr key={employee.id}>
                <td>{employee.id}</td>
              <td>{employee.loan_type}</td>
              
              <td>{employee.duration_in_years}</td>
              <td>{employee.status}</td>              
            </tr>
          ))}
        </tbody>
      </table>

                </div>
                <br/>


            </center>
        </div>
    )
}

export default AdminLoanCard;
